tables.table_schema:
CREATE TABLE trading_strategies (
    strategy_id INT PRIMARY KEY,
    strategy_name VARCHAR(255),
    parameters JSONB,
    backtest_results JSONB
);

CREATE TABLE historical_data (
    data_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    price DECIMAL(10, 2),
    volume DECIMAL(10, 2)
);

CREATE TABLE algorithm_parameters (
    algorithm_id SERIAL PRIMARY KEY,
    algorithm_name VARCHAR(255) NOT NULL,
    parameter_name VARCHAR(255) NOT NULL,
    parameter_value VARCHAR(255) NOT NULL
);

CREATE TABLE trading_algorithms (
	algorithm_id INT PRIMARY KEY,
	algorithm_name VARCHAR(255) NOT NULL,
	parameters JSONB NOT NULL
);

CREATE TABLE parameter_logs (
	log_id INT PRIMARY KEY,
	algorithm_id INT NOT NULL,
	parameter_changes JSONB NOT NULL,
	log_date TIMESTAMP NOT NULL
);

CREATE TABLE BacktestResults (
    backtest_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    parameter_variation JSONB,
    result DECIMAL
);

CREATE TABLE TradingStrategies (
    strategy_id INT PRIMARY KEY,
    strategy_name VARCHAR(255),
    strategy_code TEXT
);

CREATE TABLE ParameterVariations (
    variation_id INT PRIMARY KEY,
    backtest_id INT REFERENCES BacktestResults(backtest_id),
    parameter_name VARCHAR(255),
    parameter_value TEXT
);

CREATE TABLE BacktestLogs (
    log_id INT PRIMARY KEY,
    backtest_id INT REFERENCES BacktestResults(backtest_id),
    log_date TIMESTAMP,
    log_message TEXT
);
